webpackJsonp([296],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-learn-about-ruby-numbers.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h3>Basics:</h3>\n<ul>\n<li>Ruby has two categories of numbers - integers and floating-point (also called floats).</li>\n<li>Integers are whole numbers that can be positive or negative but cannot be fractions.</li>\n<li>Depending on their size, integers can have the class <code>Fixnum</code> or <code>Bignum</code>.</li>\n<li>Floats are numbers with a decimal place.</li>\n</ul>\n<h2>Examples:</h2>\n<pre><code>x = 5.5\nx.class\n# returns\nFloat\n\nx = 5\nx.class\n# returns\nFixnum\n\nx = 11122233344455566677\nx.class\n# returns\nBignum # basically, Bignum is a very large number\n# [read this article for more info](http://ruby-doc.org/core-2.0.0/Bignum.html)\n</code></pre>\n<h2>References:</h2>\n<ul>\n<li><a href="http://ruby-doc.org/core-2.2.0/Integer.html">The official Ruby documentation for integers</a>.</li>\n<li><a href="http://ruby-doc.org/core-2.2.0/Float.html">The official Ruby documentation for floats</a>.</li>\n</ul>',frontmatter:{title:"Learn About Ruby Numbers",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/learn-about-ruby-numbers/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/learn-about-ruby-numbers/"}}}});
